def funcImp(arg1):
    freq_dict = defaultdict(int)
    for element in arg1:
        freq_dict[element] += 1
    freq_list = sorted(freq_dict.items(), key=lambda x: x[1], reverse=True)
    most_frequent = [freq_list[0][0]]
    max_freq = freq_list[0][1]
    for element, freq in freq_list[1:]:
        if freq == max_freq:
            most_frequent.append(element)
        else:
            break
    return most_frequent']

