    def __init__(self):
        self.tree = {}

    def add(self, num):
        current = self.tree
        for b in '{0:032b}'.format(num):
            if b not in current:
                current[b] = {'count': 0}
            current[b]['count'] += 1
            current = current[b]

    def count(self, num):
        current = self.tree
        for b in '{0:032b}'.format(num):
            if b not in current:
                return 0
            current = current[b]
        return current['count']

